import "./style/main.css";
import { Router, Route } from "react-router-dom";
import Home from "./pages/Home";
import Collection from "./pages/Collection";

function App() {
	return (
		<div className='App'>
			<Route exact path='/'>
				<Home />
			</Route>
			<Route exact path='/Collection'>
				<Collection />
			</Route>
		</div>
	);
}

export default App;
